-- ----------------------------
-- Table structure for `t_project`
-- ----------------------------
DROP TABLE IF EXISTS `t_project`;
CREATE TABLE `t_project` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(500) DEFAULT NULL COMMENT '项目名称',
  `language` varchar(200) DEFAULT NULL COMMENT '开发语言及版本',
  `build_info` varchar(3000) DEFAULT NULL COMMENT '编译说明',
  `have_test` char(1) DEFAULT '0' COMMENT '有测试用例(0无 1有)',
  `have_code` char(1) DEFAULT '0' COMMENT '是否有源码(0无 1有)',
  `have_release` char(255) DEFAULT '0' COMMENT '是否有发布版本(0无 1有)',
  `coder` varchar(500) DEFAULT NULL COMMENT '开发人员',
  `server` varchar(200) DEFAULT NULL COMMENT '应用服务器及版本',
  `os` varchar(200) DEFAULT NULL COMMENT '操作系统',
  `db` varchar(200) DEFAULT NULL COMMENT '数据库',
  `release_time` datetime DEFAULT NULL COMMENT '发布时间',
  `status` char(1) DEFAULT '0' COMMENT '状态（0 正常，1 下线）',
  `discard_time` datetime DEFAULT NULL COMMENT '下线时间',
  `memo` varchar(500) DEFAULT NULL COMMENT '备注',
  `coder_svn` varchar(300) DEFAULT NULL COMMENT '开发svn',
  `tester_svn` varchar(300) DEFAULT NULL COMMENT '测试svn',
  `have_doc` varchar(255) DEFAULT NULL COMMENT '是否有文档',
  `home` varchar(255) DEFAULT NULL COMMENT '归属',
  `area` varchar(255) DEFAULT NULL COMMENT '应用地区',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8;

