DROP TABLE IF EXISTS `t_work_order`;
CREATE TABLE `t_work_order` (
  `ID` int(11) NOT NULL AUTO_INCREMENT,
  `APPLY_DATE` datetime DEFAULT NULL COMMENT '申请时间',
  `PROJECT_ID` int(11) DEFAULT NULL COMMENT '项目ID',
  `APPLY_USER_ID` int(11) DEFAULT NULL COMMENT '申请人ID',
  `BUSINESS_AUDIT_USER_ID` int(11) DEFAULT NULL COMMENT '业务部门审核人ID',
  `BUSINESS_AUDIT_DATE` datetime DEFAULT NULL COMMENT '业务部门审核时间',
  `CODER_ID` int(11) DEFAULT NULL COMMENT '开发用户ID',
  `CODER_AUDIT_ID` int(11) DEFAULT NULL COMMENT '开发部门审核人员ID',
  `CODER_AUDIT_DATE` datetime DEFAULT NULL COMMENT '开发部门审核时间',
  `TESTER_ID` int(11) DEFAULT NULL COMMENT '测试人员ID',
  `TESTER_AUDIT_ID` int(11) DEFAULT NULL COMMENT '测试部门审核人ID',
  `TEST_AUDIT_DATE` datetime DEFAULT NULL COMMENT '测试部门审核时间',
  `WEB_MASTER_ID` int(11) DEFAULT NULL COMMENT '运维人员ID',
  `DEPLOY_DATE` datetime DEFAULT NULL COMMENT '上线部署时间',
  `VERIFY_DATE` datetime DEFAULT NULL COMMENT '确认时间',
  `CODER_VERSION` varchar(200) DEFAULT NULL COMMENT '开发版本',
  `DOMAIN` varchar(200) DEFAULT NULL COMMENT '域名',
  `CODER_SVN` varchar(300) DEFAULT NULL COMMENT '开发SVN地址',
  `TEST_VERSION` varchar(200) DEFAULT NULL COMMENT '测试版本',
  `TEST_SVN` varchar(300) DEFAULT NULL COMMENT '测试SVN地址',
  `DEVELOP_EXPLAIN` varchar(500) DEFAULT NULL COMMENT '开发发布说明',
  `MEMO` varchar(500) DEFAULT NULL COMMENT '备注',
  `PROC_INST_ID` varchar(255) DEFAULT NULL,
  `STATUS` varchar(255) DEFAULT NULL,
  `APPLY_USER` varchar(100) DEFAULT NULL COMMENT '申请人',
  `BUSINESS_AUDIT_USER` varchar(100) DEFAULT '' COMMENT '审核主管',
  `CODER` varchar(100) DEFAULT NULL COMMENT '开发人员',
  `CODER_AUDIT` varchar(100) DEFAULT NULL COMMENT '开发部门审核人',
  `TESTER` varchar(100) DEFAULT NULL COMMENT '测试人员',
  `TESTER_AUDIT` varchar(100) DEFAULT NULL COMMENT '测试部门审核人',
  `WEB_MASTER` varchar(100) DEFAULT NULL COMMENT '运维人员',
  `CODER_DATE` datetime DEFAULT NULL COMMENT '开发提交时间',
  `TESTER_DATE` datetime DEFAULT NULL COMMENT '测试提交时间',
  `WEB_MASTER_AUDIT` varchar(100) DEFAULT NULL COMMENT '运维部门审核人',
  `WEB_MASTER_AUDIT_ID` int(11) DEFAULT NULL COMMENT '运维部门审核人ID',
  `WEB_MASTER_AUDIT_DATE` datetime DEFAULT NULL COMMENT '运维部门审核时间',
  `PRIORITY` int(11) DEFAULT NULL,
  `TYPE` varchar(50) DEFAULT '类别',
  `COMMITER` varchar(100) DEFAULT NULL COMMENT '入库人员姓名',
  `COMMITER_ID` int(11) DEFAULT NULL COMMENT '入库人员ID',
  `TEST_DESC` varchar(500) DEFAULT NULL COMMENT '测试描述',
  `COMMITER_DATE` datetime DEFAULT NULL COMMENT '入库时间',
  `domain_ID` int(11) DEFAULT NULL,
  PRIMARY KEY (`ID`),
  KEY `FK_7cmqn5dsh006u9s1uv7at9chl` (`PROJECT_ID`),
  KEY `FK_dqcuii80ey7b9ly7jurkdv93` (`domain_ID`),
  CONSTRAINT `FK_7cmqn5dsh006u9s1uv7at9chl` FOREIGN KEY (`PROJECT_ID`) REFERENCES `t_project` (`id`),
  CONSTRAINT `FK_dqcuii80ey7b9ly7jurkdv93` FOREIGN KEY (`domain_ID`) REFERENCES `t_domain` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=74 DEFAULT CHARSET=utf8;

